class MeasureManager(Base):
    """
    The MeasurementManager class provides some generic measurement utilities that can be used for most entity types.
    """
    def __init__(self):
        pass
    @staticmethod
    def cast(arg):
        return MeasureManager()
    def getOrientedBoundingBox(self, geometry, lengthVector, widthVector):
        """
        Calculates an oriented bounding box for the input geometry. The bounding box is tight fitting to the input geometry and is particularly useful when you want to calculate a bounding box that is not oriented to be parallel to the model x-y-z plane. The height direction is automatically determined using the length and width directions.

        geometry : The geometry to calculate the bounding box for. This can be any of the B-Rep related entities.
        lengthVector : The direction the length of the oriented bounding box will be measured in. The magnitude of the vector is ignored and only the direction is used.
        widthVector : The direction the width of the oriented bounding box will be measured in. The magnitude of the vector is ignored and only the direction is used. This must be perpendicular to the length vector.

        Returns an OrientedBoundingBox3D object which provides the information that defines an oriented bounding box.
        """
        return OrientedBoundingBox3D()
    def measureMinimumDistance(self, geometryOne, geometryTwo):
        """
        Measures the minimum distance between the two input geometries.

        geometryOne : The first geometry to measure from. This can be an Occurrence, any B-Rep entity (BRepBody, BRepFace, BRepEdge, BRepVertex, etc.), any construction geometry, any sketch entities, and any temporary 3D geometry (Cylinder, Plane, Line3D, etc.).
        geometryTwo : The second geometry to measure to. This can be an Occurrence, any B-Rep entity (BRepBody, BRepFace, BRepEdge, BRepVertex, etc.), any construction geometry, any sketch entities, and any temporary 3D geometry (Cylinder, Plane, Line3D, etc.).

        A MeasureResults object that contains the distance and the two points on the geometry that the distance that was measured between them in centimeters.
        """
        return MeasureResults()
    def measureAngle(self, geometryOne, geometryTwo, geometryThree):
        """
        Measures the angle between the input geometry.

        geometryOne : The first geometry to measure the angle to. This can be any 3D point geometry (Construction Point, Vertex, SketchPoint, or Point3D), any 3D linear geometry (Construction Axis, linear BRepEdge, SketchLine, Line3D, or InfiniteLine3D), or any planar geometry (Construction Plane, planar BRepFace, or Plane).
        geometryTwo : The second geometry to measure the angle to. This can be any 3D point geometry (Construction Point, Vertex, SketchPoint, or Point3D), any 3D linear geometry (Construction Axis, linear BRepEdge, SketchLine, Line3D, or InfiniteLine3D), or any planar geometry (Construction Plane, planar BRepFace, or Plane).
        geometryThree : The optional third geometry to measure the angle to. This is only used when the first two geometries are points and this defines the third point. When three points define a triangle, the apex of the triangle is defined by the second point. A point can be defined by a Cosntruction Point, Vertex, SketchPoint, or Point3D object.

        A MeasureResults object that contains the angle and the two points on the geometry that the angle that was measured between them in radians.
        """
        return MeasureResults()

class MeasureResults(Base):
    def __init__(self):
        pass
    @staticmethod
    def cast(arg):
        return MeasureResults()
    @property
    def value(self):
        """
        The measurement value. If the measurement is a distance this value will be in centimeters. If it's an angle then it will be in radians.
        """
        return float()
    @property
    def positionOne(self):
        """
        For a distance measurement, this is the point on the first entity where the measurement was made from. For an angle measurement this is one of the three points defining the angle.
        """
        return Point3D()
    @property
    def positionTwo(self):
        """
        For a distance measurement, this is the point on the second entity where the measurement was made to. For an angle measurement this is one of the three points defining the angle.
        """
        return Point3D()
    @property
    def positionThree(self):
        """
        This point is only used for angle measurements and is one of the three points defining the angle.
        """
        return Point3D()

