    def create(self, centerPoint, lengthDirection, widthDirection, length, width, height):
        """
        Creates a transient oriented bounding box object.

        centerPoint : The center point of the oriented box.
        lengthDirection : A Vector3D object that defines the direction of the length of the oriented bounding box. The magnitude of the vector is ignored and just the direction is used.
        widthDirection : A Vector3D object that defines the direction of the width of the oriented bounding box. The magnitude of the vector is ignored and just the direction is used. The width direction must be perpendicular to the length direction.
        length : The length of the oriented bounding box in centimeters.
        width : The width of the oriented bounding box in centimeters. The width of the box is always perpendicular to the length.
        height : The height of the oriented bounding box in centimeters. The height of the box is perpendicular to the length-width plane using the right-hand rule where you cross the length into the width.

        Returns the new oriented bounding box.
        """
        return OrientedBoundingBox3D()
